                  <div class="widget widget-links mb-4">
                    <ul class="widget-list">
                      <li class="widget-list-item">
                        <a
                          class="widget-list-link"
                          href="shop-grid-ls.html"
                          routerLink="/addNewProduct"
                          >Add New Product</a
                        >
                      </li>
                      <li class="widget-list-item">
                        <a
                          class="widget-list-link"
                          href="shop-grid-rs.html"
                          routerLink="/category"
                          >Add New Category</a
                        >
                      </li>
                      <li class="widget-list-item">
                        <a
                          class="widget-list-link"
                          href="shop-grid-rs.html"
                          routerLink="/brand"
                          >Add New Brand</a
                        >
                      </li>
                    </ul>
                  </div>
                </div>
              </div>
            </div>
          </li>

          <li class="nav-item dropdown">
            <a
