            <ul class="dropdown-menu">
              <li class="dropdown-divider"></li>
              <li *ngIf="!isAdmin()">
                <a class="dropdown-item" routerLink="myOrders">My-Orders</a>
              </li>
              <li *ngIf="isAdmin()">
                <a class="dropdown-item" routerLink="orderInformation"
                  >Order Information</a
